import React from "react";

const EditableRow = ({}) => {
    return(
        <tr>
            <td>{contact.id}</td>
            <td>{
                <input type="text"
                        required="required"
                        placeholder="Enter a first name..."
                        name="First Name">
                    value={editFormatData.phoneNumber}
                    {/*onChange={handleEditFormChange}*/}
                </input>}
            </td>
            <td>{<input type="text"
                        required="required"
                        placeholder="Enter a last name..."
                        name="Last Name">
                {/*onChange={handleEditFormChange}*/}
            </input>}</td>
            <td>{<input type="text"
                        required="required"
                        placeholder="Enter a email..."
                        email="email">
                {/*onChange={handleEditFormChange}*/}
            </input>}</td>
            <td>{<input type="text"
                        required="required"
                        placeholder="Enter a phone..."
                        name="Phone">
                {/*onChange={handleEditFormChange}*/}
            </input>}</td>
            <td>{}</td>
        </tr>
    );
};
export default EditableRow;
